import React, { useState,useEffect } from "react";
import axios from "axios";
import base_url from "../api/bootapi";
import OneList from "./OneList";

const AllList = () => {

    const getAllListFromServer = () => {
        axios.get(`${base_url}/products`).then(
            (response) =>{
               // console.log(response);
               console.log(response.data);
              // setProduct(response.data);
            },
            (error) => {
                console.log(error);
            }
        );
    };

    useEffect(() => {
        getAllListFromServer();
    }, []);

    const [products, setProducts] = useState([
        {productId: "1", productName: "Fridge", prize: "1000"},
        {productId: "2", productName: "Washing machine", prize: "1020"},
        {productId: "3", productName: "TV", prize: "900"},
        {productId: "4", productName: "Laptop", prize: "1400"},
    ]);

    return(
        <div>
            <p>List of all products</p>

            {
                products.length > 0
                    ? products.map((item) => <OneList onelist={item} />)
                    : "No courses"
            }
        </div>
    );

}

export default AllList
